WITH C1 AS
(
  SELECT		DISTINCT
				  provider_no
				, event_date
				, call_no
				, starttime AS ts
				, 1 AS TYPE
				, ROW_NUMBER() OVER(PARTITION BY provider_no, event_date  ORDER BY provider_no, event_date, starttime, call_no) AS start_ordinal
  FROM			#temp_calls

  UNION ALL

  SELECT		DISTINCT
				  provider_no
				, event_date
				, call_no
				, endtime	AS ts
				, -1
				, NULL
  FROM			#temp_calls
)
,C2 AS
(
  SELECT		  C1.provider_no
                , c1.event_date
				, c1.call_no
				, C1.ts
                , C1.TYPE
                , C1.start_ordinal
				, ROW_NUMBER() OVER( PARTITION BY C1.provider_no, event_date ORDER BY provider_no, event_date, ts, TYPE) AS start_or_end_ordinal
  FROM C1
)

SELECT			  C2.provider_no
				, c2.event_date
				--, c2.ts
				--, c2.TYPE
				--, start_ordinal
				--, start_or_end_ordinal
				, MAX (2 * start_ordinal - start_or_end_ordinal) AS cc
FROM			C2
WHERE			TYPE = 1
GROUP BY		C2.provider_no
				,c2.event_date
;


